import React from 'react';

const TodoList = (props) => {

    

    return (
        <>
        <div className='todo_style'>
        <i className="fa fa-times-circle" aria-hidden="true" onClick={props.onSelect} />
        <li>{props.text}</li>
        </div>
        </>
    )
}

export default TodoList;
